import React, { useEffect, useState } from 'react';
import axios from 'axios';
axios.get('/groceries', { headers: { Authorization: `Bearer ${localStorage.getItem('token')}` } })

export default function Dashboard() {
  const [groceries, setGroceries] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      setError('‚ö† Please log in to see groceries.');
      return;
    }

    axios.get('http://localhost:5000/api/groceries', {
      headers: { Authorization: `Bearer ${token}` }
    })
    .then(res => setGroceries(res.data))
    .catch(() => setError('‚ùå Failed to load groceries.'));
  }, []);

  if (error) return <div className="p-6 text-red-600">{error}</div>;

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">üõí Grocery Manager ‚Äî Dashboard</h1>
      <ul className="space-y-2">
        {groceries.map(g => (
          <li key={g._id} className="p-3 bg-white shadow rounded">
            {g.name} ‚Äî ‚Çπ{g.price}
          </li>
        ))}
      </ul>
    </div>
  );
}
